import "./App.css";
import React from "react";

function App(props) {

  let arrayList = [
    'Tarun'

  ]

  for(let i = 0; i < props.items.length; i++) {
    arrayList.push(
      <li key={i} item={props.items[i]} />
    );
  }

  return (
    <div className="container">
      {arrayList}
    </div>
  );
}

export default App;
